//Codificar un algoritmo paralelo que permita sumar todos los elementos de un vector de Tamaño 1000. 

	int generarNumero(int hasta){
		int numero;
			numero = 1 + rand()%hasta;
	return numero;	}
////////////////////////////////////////////////////////////////////////////////////////
	void mostrar(int n, int vector[]){
		cout<<"\n\t - NUMEROS ORDENADOS:";
		for(int i = 0; i < n; i++){
			cout<<"\n\t\t> "<<i<<" = "<<vector[i];
			cin.clear(); 
		}
	}
////////////////////////////////////////////////////////////////////////////////////////
	int main() { 
	 	int n;
	 	printf("\n - INGRESE LA LONGITUD DEL VECTOR(n):\t");
		cin>>n;
		int vector[n] = {};
		int i, auxiliar, suma=0;
			 for(i=0; i < n; ++i){
			 	auxiliar = generarNumero(100);
			 	vector[i] = auxiliar;
			 }
			 //mostrar(TAM,vector);
		#pragma omp parallel for reduction(+:suma) private(id)
		{
			for(i=0; i < n; ++i){
				suma = suma + vector[i];
			}
		}
	printf("\n - SUMA TOTAL = %u\n",suma);
	}

