#include <iostream>
using namespace std;

int max(int m, int n) {
    if (m > n) {
        return m;
    }
    else {
        return n;
    }
}

int main()
{
    int a, b, z;
    cout << "Enter the numbers a & b: \n";
    cin >> a >> b;

   

    z = max(a, 2 * b) * max(2*a-b,b);
