}

import datetime


class Array:

    def __init__(self, arr=None):
        if arr is None:
            self.arr = []
        else:
            if isinstance(arr, list):
                self.arr = arr
            else:
                raise Exception

    def __str__(self):
        return f"list is {self.arr}"

    def __call__(self, *args, **kwargs):
        return "Function called"

    def plus_one(self):
        self.arr = [x + 1 for x in self.arr]

    def get(self):
        return self.arr


class Decor_2:

    def __init__(self, func):
        self.func = func

    def __call__(self, *args, **kwargs):
        print(f"Function call used")
        return self.func(*args, *kwargs)


class Decorator:

    def __init__(self, function=None):
        self.func = function

    @Decor_2
    def __call__(self, *args, **kwargs):
        try:
            res = self.func(*args)
            return res
        except Exception as e:
            print(f"Mistake {e}")
        finally:
            return f"Function call worked without mistakes"

    def time(self):
        pass


def timer(function):
    @cache
    def wrapper(*args, **kwargs):
        now = datetime.datetime.now()
        res = function(*args, **kwargs)
        print(datetime.datetime.now() - now)
        return res

    return wrapper


def cache(function):
    def wrapper(*args, **kwargs):
        return function.__sizeof__()

    return wrapper


@Decorator
def function(a, b):
    return a + b


class Human:
    def __init__(self, age, name):
        self.age = age
        self.name = name

    def __str__(self):
        return f"User with name {self._name} and age {self.age}"

    @property
    def name(self):
        return self._name

